import { createTheme } from "@material-ui/core";

const theme = createTheme({
    palette:{
        primary:{
            main: '#ffff'
        },
        secondary:{
            main:'#109325'
        }
    },
    Appbar:{
        hight:'5rem'
    }
});

export default theme;
